import React from 'react'
import { animateScroll as scroll, scrollSpy, scroller } from 'react-scroll'




function ToTop(props) {

    scrollToTop = () => {
        scroll.scrollToTop()
    }

    return (
        <button onClick={this.scrollToTop}> Off we go! </button>
    )
}


export default ToTop
